import React, { Component } from "react";
import Icon from "@material-ui/core/Icon";
import IconButton from '@material-ui/core/IconButton';

class App extends Component {
  render() {
    return (
      <div>
        <IconButton color="primary">
          <Icon>delete</Icon>
        </IconButton>

        <IconButton color="secondary">
          <Icon>alarm</Icon>
        </IconButton>
      </div>
    );
  }
}

export default App;
